// src/components/MemoItem.js

import React from 'react';

const MemoItem = ({ memo, onDelete }) => {
  return (
    <td>
      <span>{memo.title}</span>
      <span>{memo.content}</span>
      <button onClick={() => onDelete(memo.id)}>Delete</button>
    </td>
  );
};

export default MemoItem;
